import React,{Component} from "react";
import "./NotSignedIn.css";
import { Link } from "react-router-dom";
import SignUpPage from "./SignUpPage/SignUpPage";

class NotSignedIn extends Component{
    constructor(props){
        super(props);

    }
    render(){
        return(
            <div className="NotSignedIn_nav">
                <h2>ALT-F4</h2>
                <div className="NotSignedIn_right">
                    <Link exact  className="NotSignedIn_EditorLink"
                    to={{
                        pathname: '/signup',
                          data:{
                            googleLogin:this.props.googleLogin
                          }
                        }}
                    >
                        <SignUpPage />
                        Sign Up
                    </Link>
                    <Link exact to="/login" className="NotSignedIn_EditorLink">
                        Login
                    </Link>
                </div>
        </div>
        )
    }
}

export default NotSignedIn;
